import React, { Component } from 'react';
import './App.css';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import FaceRecognition from './components/FaceRecognition/FaceRecognition'
import ParticlesBg from 'particles-bg'

class App extends Component {
  constructor() {
    super();
    this.state = {
      input: '',
      imageUrl: '',
      boundingBoxes: []
      // boundingBox: {
      //   bottom_row: 0.7241363,
      //   left_col: 0.25099722,
      //   right_col: 0.6566857,
      //   top_row: 0.2896744
      // }
      // boundingBoxes: [{top_row: 0.0644997, left_col: 0.62505627, bottom_row: 0.3315545, right_col: 0.76201445},
      //                 {top_row: 0.32936665, left_col: 0.056086656, bottom_row: 0.7006539, right_col: 0.24840929},
      //                 {top_row: 0.32970005, left_col: 0.5559767, bottom_row: 0.6212731, right_col: 0.69629955},
      //                 {top_row: 0.2693868, left_col: 0.824326, bottom_row: 0.5936605, right_col: 0.9795384},
      //                 {top_row: 0.2533735, left_col: 0.31485358, bottom_row: 0.53393286, right_col: 0.46973512}]
    }
  }

  calculateFaceLocation = (result) => {
    const regionsArray = result.outputs[0].data.regions;
    const boxDataArray = regionsArray.map(item => {
      const dimensionsObj = item.region_info.bounding_box;
      return dimensionsObj;
    });
    this.setState({ boundingBoxes: boxDataArray });
  }

  onInputChange = (event) => {
    this.setState({ input: event.target.value })
  }

  onButtonSubmit = () => {
    this.setState({ imageUrl: this.state.input });
    ///////////////////////////////////////////////////////////////////////////////////////////////////
    // In this section, we set the user authentication, user and app ID, model details, and the URL
    // of the image we want as an input. Change these strings to run your own example.
    //////////////////////////////////////////////////////////////////////////////////////////////////

    // Your PAT (Personal Access Token) can be found in the portal under Authentification
    const PAT = 'ffe67f6f20cd4de5aef921dfd72cc5fa';
    // Specify the correct user_id/app_id pairings
    // Since you're making inferences outside your app's scope
    const USER_ID = 'tjpaulino89';       
    const APP_ID = 'Face-Detection';
    // Change these to whatever model and image URL you want to use
    const MODEL_ID = 'face-detection';
    const MODEL_VERSION_ID = '6dc7e46bc9124c5c8824be4822abe105';    
    const IMAGE_URL = this.state.input;
    // 'https://samples.clarifai.com/metro-north.jpg';

    ///////////////////////////////////////////////////////////////////////////////////
    // YOU DO NOT NEED TO CHANGE ANYTHING BELOW THIS LINE TO RUN THIS EXAMPLE
    ///////////////////////////////////////////////////////////////////////////////////

    const raw = JSON.stringify({
        "user_app_id": {
            "user_id": USER_ID,
            "app_id": APP_ID
        },
        "inputs": [
            {
                "data": {
                    "image": {
                        "url": IMAGE_URL
                    }
                }
            }
        ]
    });

    const requestOptions = {
        method: 'POST',
        headers: {
            'Accept': 'application/json',
            'Authorization': 'Key ' + PAT
        },
        body: raw
    };

    // NOTE: MODEL_VERSION_ID is optional, you can also call prediction with the MODEL_ID only
    // https://api.clarifai.com/v2/models/{YOUR_MODEL_ID}/outputs
    // this will default to the latest version_id

    fetch("https://api.clarifai.com/v2/models/" + MODEL_ID + "/versions/" + MODEL_VERSION_ID + "/outputs", requestOptions)
        .then(response => response.json())
        .then(result => this.calculateFaceLocation(result))
        .catch(error => console.log('error', error));
  }

  render() {
    return (
      <div className="App">
        <ParticlesBg color="#d9ecff" num={200} type="cobweb" bg={true} />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm onInputChange={this.onInputChange} onButtonSubmit={this.onButtonSubmit}/>
        <FaceRecognition imageUrl={this.state.imageUrl} boundingBoxes={this.state.boundingBoxes}/>
      </div>
  );
  }

}

export default App;
